import * as S from './bloggy.styles';
import * as GS from '../../styles/global';
import Link from 'next/link';

const Bloggy = ({ posts }) => {
	console.log(posts);
	return (
		<S.BlogContainer>
			<div>
				{posts.map((post) => {
					return (
						<ul key={post.excerpt}>
							<li>{post.featured_image}</li>
							<li>{post.title}</li>
							<li>{post.excerpt}</li>
						</ul>
					);
				})}
			</div>
			<div>Right</div>
		</S.BlogContainer>
	);
};

export default Bloggy;
